import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

import Show from './component/Show';

// import netflix from './list';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

  <div>
    <h1>Hello world</h1>
    <Show names={netflix[0]}></Show>
    <Show names={netflix[1]}></Show>
    <Show names={netflix[2]}></Show>
    <Show names={netflix[3]}></Show>
  </div>
);
